function showNotification(){Notification.requestPermission(function(i){"granted"===i&&navigator.serviceWorker.ready.then(function(i){i.showNotification("Vibration Sample",{body:"Buzz! Buzz!",icon:"favicon/android-chrome-192x192.png",vibrate:[200,100,200,100,200,100,200],tag:"vibration-sample"})})})}navigator.serviceWorker.register("js/sw.js");